import styled from "styled-components";
import coffeeImage from '../images/coffeeImage/coffeeImage.jpg'


export const HomeCollectionPlant = styled.div`
background: linear-gradient(to right, rgba(0,0,0,0), rgba(0,0,0,0)), url(${coffeeImage});
height: 50vh;
background-position: center;
background-size: 100%;
`
